import React, { useState } from 'react'
import {  useNavigate } from 'react-router-dom'
import Swal from 'sweetalert2'

const Register = () => {
    const[fname,setfname]=useState()
    const[lname,setlname]=useState()
    const[email,setemail]=useState()
    const[pwd,setpwd]=useState()

    const navigate=useNavigate()
    const submit=async()=>{
        const data={fname,lname,email,pwd}
        try{
const res=await fetch("http://localhost:9000/api/register",{
    method:"post",
    body:JSON.stringify(data),
    headers:{
        'Content-type':'application/json;charset=utf-8',
    },
});
if(res.ok){
    const result=await res.json()
    if(result.statuscode===1){
        await Swal.fire({
            icon: 'success',
            title: 'Login Successful',
            text: 'You have successfullyRegistered!',
            timer: 2000,
            showConfirmButton: false
        });
        navigate("/login")
   
    }else{
        Swal.fire({
            icon: 'error',
            title: 'Registration Required',
            text: 'Please register first before logging in',
            confirmButtonText: 'OK'
        });
    }
        
}
    }catch(err){
console.log(err)
        }

    }
  return (
    <div>
        <div className="breadcrumb-section">
        <div className="container">
            <h2>Create account</h2>
            <nav className="theme-breadcrumb">
                <ol className="breadcrumb">
                    <li className="breadcrumb-item">
                        <a href="index.html">Home</a>
                    </li>
                    <li className="breadcrumb-item active">Create account</li>
                </ol>
            </nav>
        </div>
    </div>
    <section className="login-page section-b-space">
        <div className="container">
            <h3>create account</h3>
            <div className="theme-card">
                <div className="theme-form">
                    <div className="row">
                        <div className="col-md-6">
                            <div className="form-box">
                                <label for="email" className="form-label">First Name</label>
                                <input type="text" className="form-control" id="fname" placeholder="First Name" required="" onChange={(e)=>setfname(e.target.value)}/>
                            </div>
                        </div>
                        <div className="col-md-6">
                            <div className="form-box">
                                <label for="review" className="form-label">Last Name</label>
                                <input type="text" className="form-control" id="lname" placeholder="Last Name"
                                    required="" onChange={(e)=>setlname(e.target.value)}/>
                            </div>
                        </div>
                    </div>
                    <div className="row">
                        <div className="col-md-6">
                            <div className="form-box">
                                <label for="email" className="form-label">email</label>
                                <input type="text" className="form-control" id="email" placeholder="Email" required="" onChange={(e)=>setemail(e.target.value)}/>
                            </div>
                        </div>
                        <div className="col-md-6">
                            <div className="form-box">
                                <label for="review" className="form-label">Password</label>
                                <input type="password" className="form-control" id="review"
                                    placeholder="Enter your password" required="" onChange={(e)=>setpwd(e.target.value)}/>
                            </div>
                        </div>
                        <div className="col-12">
                            <button onClick={submit}
                            className="btn btn-solid w-auto">create Account</button> 
                        </div>
                    </div>
                </div>
            </div>
        </div>
    </section>
      
    </div>
  )
}

export default Register
